export const TopicData = {
  React: {
    "Hello World": [
      "const element = <h1>Hello, world!</h1>;",
      "It displays a heading saying “Hello, world!” on the page.",
    ],
  },
  Angular: {
    "Hello World": [
      "const element = <h1>Hello, world!</h1>;",
      `ReactDOM.render(
        <h1>Hello, world!</h1>,
        document.getElementById('root')
        );`,
      "It displays a heading saying “Hello, world!” on the page.",
    ],
  },
  NodeJS: {
    "Hello World": [
      "const element = <h1>Hello, world!</h1>;",
      `ReactDOM.render(
        <h1>Hello, world!</h1>,
        document.getElementById('root')
        );`,
      "It displays a heading saying “Hello, world!” on the page.",
    ],
  },
};
